import React, { useEffect, useState } from 'react';
import ReactFlow, { 
  Background, 
  Controls,
  MiniMap
} from 'reactflow';
import 'reactflow/dist/style.css';

// Custom node components defined as separate functions
const ClusterNode = ({ data }) => (
  <div style={{
    padding: '10px',
    borderRadius: '5px',
    background: 'linear-gradient(to bottom, #1E40AF, #3B82F6)',
    color: 'white',
    width: '180px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    border: '2px solid #1E3A8A'
  }}>
    <div style={{ fontWeight: 'bold' }}>{data.label}</div>
    {data.hoverLabel && <div style={{ fontSize: '12px', marginTop: '5px' }}>{data.hoverLabel}</div>}
  </div>
);

const ObjectNode = ({ data }) => (
  <div style={{
    padding: '10px',
    borderRadius: '8px',
    background: 'linear-gradient(to bottom, #065F46, #10B981)',
    color: 'white',
    width: '160px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    border: '2px solid #064E3B'
  }}>
    <div style={{ fontWeight: 'bold' }}>{data.label}</div>
    {data.hoverLabel && <div style={{ fontSize: '12px', marginTop: '5px' }}>{data.hoverLabel}</div>}
  </div>
);

const HarmonisedNode = ({ data }) => (
  <div style={{
    padding: '8px',
    borderRadius: '8px',
    background: 'linear-gradient(to bottom, #581C87, #8B5CF6)',
    color: 'white',
    width: '140px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    border: '2px solid #4C1D95'
  }}>
    <div>{data.label}</div>
    {data.hoverLabel && <div style={{ fontSize: '11px', marginTop: '5px' }}>{data.hoverLabel}</div>}
  </div>
);

// Define node types
const nodeTypes = {
  cluster: ClusterNode,
  object: ObjectNode,
  harmonised: HarmonisedNode
};

const GraphVisualization = ({ graphData, dimensions }) => {
  const [nodes, setNodes] = useState([]);
  const [edges, setEdges] = useState([]);

  // Process graph data to nodes and edges
  useEffect(() => {
    if (graphData && graphData.nodeDataArray && graphData.linkDataArray) {
      // Convert GoJS nodes to React Flow nodes
      const flowNodes = graphData.nodeDataArray.map(node => ({
        id: node.key,
        type: node.category === 'system' ? 'cluster' : 
              node.category === 'object' ? 'object' : 'harmonised',
        position: { x: Math.random() * 500, y: Math.random() * 500 }, // Random positions for now
        data: {
          label: node.label,
          hoverLabel: node.hoverLabel || ''
        }
      }));
      
      // Convert GoJS links to React Flow edges
      const flowEdges = graphData.linkDataArray.map((link, index) => ({
        id: `edge-${index}`,
        source: link.from,
        target: link.to,
        animated: false,
        style: { stroke: '#555', strokeWidth: 2 },
        type: 'smoothstep'
      }));
      
      setNodes(flowNodes);
      setEdges(flowEdges);
    }
  }, [graphData]);

  // Default dimensions if not provided
  const height = dimensions?.height || '600px';
  const width = dimensions?.width || '100%';

  return (
    <div style={{ width, height }}>
      {graphData ? (
        <ReactFlow
          nodes={nodes}
          edges={edges}
          nodeTypes={nodeTypes}
          fitView
        >
          <Controls />
          <MiniMap />
          <Background variant="dots" gap={12} size={1} />
        </ReactFlow>
      ) : (
        <div style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "100%",
          color: "#64748b",
          fontSize: "16px",
          fontStyle: "italic"
        }}>
          Graph will be displayed here after uploading a file.
        </div>
      )}
    </div>
  );
};

export default GraphVisualization;
